let stylesObj = {};
let definedList = []
export function stylesCache (componentName, state) {
    if (!(componentName in definedList)) {
        definedList.push(componentName);
        stylesObj.componentName = state;
    }
}

export function getStyle (componentName) {
    return stylesObj[componentName];
}
